import { headerContents } from "./components/Header";
import { sendContents } from "./components/Content";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          {headerContents()}
        </h1>
        <p>
          {sendContents()}
        </p>
      </header>
    </div>
  );
}

export default App;
